Индонези́йский Калиманта́н или Индонези́йское Борне́о — южная часть острова Калимантан (другое название острова — Борнео), принадлежащая Индонезии. На острове расположены также восточная часть Малайзии и Бруней. В английском языке индонезийскую часть острова принято называть просто Калимантан (англ. Kalimantan), в то время как весь остров известен под названием Борнео (англ. Borneo). Индонезийская часть острова занимает площадь 582 593 км² или примерно 78 % территории острова (общая площадь острова — 743 330 км²), в ней проживает около 70 % населения острова. Индонезийская часть Калимантана включает в себя пять провинций: 
* Западный Калимантан; 
* Центральный Калимантан; 
* Южный Калимантан; 
* Восточный Калимантан; 
* Северный Калимантан.

Kalimantan es el nombre en indonesio de la isla de Borneo.​​ El término también es usado por el gobierno de Indonesia para referirse a las tres cuartas partes (un 73%) de la isla que están bajo su soberanía. Tiene un área de 544,150 km² y una población estimada de 14,944,742 (2014), teniendo por lo tanto una densidad demográfica sumamente baja. Actualmente 5 provincias indonesias ocupan esta región: 
* Borneo Occidental (Kalimantan Barat), capital Pontianak; 
* Borneo Central (Kalimantan Tengah), capital ; 
* Borneo Meridional (Kalimantan Selatan), capital Banjarmasin; 
* Borneo Oriental (Kalimantan Timur), capital Samarinda y 
* Borneo Septentrional (Kalimantan Utara) – capital .
